ag not on Klick Tipp, but will be added after transfering data'=>'Tag nicht auf KlickTipp, wird bei der Übertragung hinzugefügt','Tag on Klick Tipp, but not attached to current user and will be added after transfering data'=>'Tag auf KlickTipp, wird bei der Übertragung dem Kontakt hinzugefügt','Tag on KT'=>'KlickTipp','Tag to Detach'=>'Wird dem Kontakt entzogen','Tags'=>'Tags','Tags from:'=>'Tags von  ','Tags Prefixes:'=>'Tag Vorsilben:','Tags Set Title'=>'Tag-Gruppen-Name','Tags to add when the lead is transferred:'=>'Tags die wärend der Übertragung hinzugefügt werden:','Tags to add:'=>'Tags die hinzugefügt werden:','Tags to detach:'=>'Tags die entzogen werden:','Tags to remove:'=>'Tags die gelöscht werden sollen:','Tags to replace:'=>'Zu ersetzende Tags:','text'=>'Absatz/Zeile','Thank You redirect URL: '=>'Danke-Link: ','The next plugins are required for this map: '=>'Folgende Plugins sind für diese Verbindung notwendig:','The transfer of contacts stopped, because of an issue with payment. Please check your emails from support@digistore24.com!'=>'Die Übertragung deiner Kontakte wurde eingestellt, wegen eines Problems mit der Zahlung. Bitte überprüfe deine E-Mails von support@digistore24.com!','The transfer of contacts will stop soon, because of an issue with payment. Please check your emails from support@digistore24.com!'=>'Die Übertragung von Kontakten wird bald eingestellt, wegen eines Problems mit der Zahlung. Bitte überprüfe die E-Mails von support@digistore24.com!','The username or password you entered is incorrect!'=>'Der eingegebene Benutzername oder das eingegebene Kennwort ist falsch!','There is module available for this map, which will transfer user data instantly after some events.'=>'Für diese Verbindung steht ein Modul zur Verfügung, das Benutzerdaten sofort nach einem Ereignis überträgt.','There is no data to transfer'=>'Keine Daten zum Übertragen vorhanden','There is no results for this map in your DB. You can change settings in map builder.'=>'Es liegen keine Daten für diese Verbindungs in der Datenbank vor. Du kannst z.B. die Filter-Einstellungen im Verbindungsbauplatz ändern. Oder neue Daten hinzufügen.','There is no tags to create'=>'Keine Tags zum Erstellen vorhanden','Therefore during the next 7 days,'=>'Daher ist während der nächsten 7 Tage,','Therefore until <strong>%s</strong>:'=>'Daher ist bis <strong>%s</strong>:','This map has no import function'=>'Diese Verbindung hat keine import-Funktion','This Map is maintained by another user. If you want fully customize it, you need to duplicate or make it your own.'=>'Diese Verbindung wird durch einen anderen Benutzer gewartet. Wenn du sie vollständig anpassen möchtest, dupliziere die Verbindung oder mache sie zu deiner eigenen.','This map is not active:'=>'Diese Verbindung(en) ist nicht aktiv.','This module could not be used with this map as far as it doesn\'t contain required column.'=>'Dieses Modul kann mit dieser Verbindung nicht verwendet werden, da es nicht die erforderlichen Spalte enthält.','This module is created for Business Directory Plugin maps.'=>'Dieses Modul wurde für die Business Directory Plug-in Verbindung erstellt.','This module is created for Contact Form Entries maps.'=>'Dieses Modul ist für „Contact Form Entries“-Plugin-Verbindung erstellt worden. <br>Das Plugin kann mehr als nur Contact Form 7 Formulare anbinden.<br>Von folgende Formular Plugins können Daten übertragen werden: <a href="https://wordpress.org/plugins/contact-form-7/" target="_blank">Contact Form 7</a>, <a href="https://wordpress.org/plugins/jetpack/" target="_blank">JetPack Contact Form</a>, <a href="https://wordpress.org/plugins/ninja-forms/" target="_blank">Ninja Forms</a>, <a href="https://wordpress.org/plugins/formidable/" target="_blank">Formidable Forms</a>, <a href="http://codecanyon.net/item/quform-wordpress-form-builder/706149“>Quform</a>, <a href="https://wordpress.org/plugins/cforms2/" target="_blank">cformsII</a>, <a href="https://wordpress.org/plugins/contact-form-plugin/" target="_blank">Contact Form by BestWebSoft</a>, <a href="https://wordpress.org/plugins/ultimate-form-builder-lite/" target="_blank">Ultimate Form Builder</a>, <a href="https://wordpress.org/plugins/caldera-forms/" target="_blank">Caldera Forms</a> and <a href="https://wordpress.org/plugins/wpforms-lite/" target="_blank">WP Forms</a>','This module is created for Easy Appointments maps.'=>'Dieses Modul wurde für Easy Appointments-Verbindung erstellt.','This module is created for Woocommerce orders maps.'=>'Dieses Modul wurde für die Woocommerce-Verbindung erstellt.','This module is created for Wordpress user maps.'=>'Dieses Modul wurde für Wordpress-Benutzer-Verbindung erstellt.','This plugin can not be installed automatically'=>'Dieses plugin kann nicht installiert werden automatisch','This saved map refers to a table no longer present in the database.'=>'Diese gespeicherte Verbindung bezieht sich auf eine Tabelle, die nicht mehr in der Datenbank vorhanden ist oder wahr. <br>Idee: Passendes Plugin zur Verbindung installieren und mit Beispieldaten füllen.','This saved statistics refers to a map no longer present in the database.'=>'Die Statistik bezieht sich auf eine Verbindung, die nicht mehr in der Datenbank vorhanden ist.','This user can\'t be Opt-ined according to conditions.'=>'Die unter „Opt-in“ gesetzen Bedingungen verhindern ein senden und eingetragen dieses Kontakts.','This value can be less because of transfer running in background and transfer scheduled by cron.'=>'Dieser Wert kann, aufgrund der Hintergrundmassenübertragung und der geplanten automatischen Übertragung, geringer sein.','This value will be changed'=>'Es wird ein Wert geändert!','Thusday'=>'Donnerstag','time'=>'Zeit','To'=>'mit','To automatically transfer data you need to choose a "Date / Time columns" or one of the "transfer modules" or <a href="https://wp2leads-for-klick-tipp.com/web/let-us-create-a-map-for-you/" target="_blank">let us create the connections for you.</a>'=>'Für die automatisch Datenübertragung benötigst du mindestens eine "Datum-/ Zeit-Spalte" oder ein "Transfer Module" oder <a href="https://wp2leads-for-klick-tipp.com/web/let-us-create-a-map-for-you/" target="_blank">du lässt dir eine Verbindung von uns erstellen.</a>','To get a quick solution please record a <a href="https://chrome.google.com/webstore/detail/screencastify-screen-vide/mmeijimgabbpbgpdklnllpncmdofkcpn" target="_blank">screencast</a> with this software, Upload to Google Drive and <a href="https://wp2leads-for-klick-tipp.com/?p=644" target="_blank">share</a> link with all users in documentation!'=>'Um eine schnelle Lösung aus der Gemeinschaft zu erhalten, nimm ein <a href="https://chrome.google.com/webstore/detail/screencastify-screen-vide/mmeijimgabbpbgpdklnllpncmdofkcpn" target="_blank"> Screencast mit dieser freien Software auf.</a> Laden das Video zu Google Drive hoch und <a href="https://wp2leads-for-klick-tipp.com/?p=644" target="_blank"> teile den Link mit allen Benutzern in der Dokumentation! </a>','To get tags list, click Get tags button'=>'Um die Tagsliste zu laden, klicke auf Tags abrufen','To upgrade click <a href="https://www.klick-tipp.com/15194" target="_blank">here</a>.'=>'Zum Erhöhen deines KlickTipp Pakets <a href="https://www.klick-tipp.com/15194" target="_blank">klicke jetzt hier! (Öffnet in neuem Tab)</a>.</br> Schritte: Melde dich an. Wähle im Menü "Mein Konto", dann "Upgrade / Downgrade" und dann dein gewünschtes Paket.','To use your Professional version, you need to:'=>'Um die professionell Version zu nutzen musst du:','Toggle Direct Selection'=>'Direkte Spalten Auswahl einschalten','Tools'=>'Tag-Werkzeug','Total Amount'=>'Gesamt Anzahl','Total amount'=>'Gesamt','Total entries from Database'=>'Gesamtzahl der Einträge aus der Datenbank','Total licenses'=>'Gesamtlizenzen','Total transferred'=>'Gesamt übertragene','Total:'=>'Gesamt:','Transfer all immediately'=>'Alle übertragen','Transfer all users in Background'=>'Alle Kontakte im Hi