create tags from standart WP values like: <strong>post status</strong> or <strong>user capability</strong>'=>'Das Ziel ist es diese Tags vorab in KlickTipp anzulegen und sofort als E-Mail-Trigger zu nutzen, statt erst Bestellungen je Status und Benutzer mit jeder Benutzerrolle zu erstellen und zu übertragen.<br><br>Verwende diesen Abschnitt zum Erstellen von Tags aus Werten wie: <strong>post status z.B. wc-completed, wc-on-hold</strong> oder <strong>Benutzerrollen z.B. administrator oder editor</strong>.','Use this section for create tags from user input values like: <strong>post title</strong> or <strong>category title</strong>'=>'Verwende diesen Abschnitt zum Erstellen von Tags aus Benutzereingabewerten wie: <strong>Produkt-Titel oder</strong>, <strong>Kategorie-Titel</strong> oder <strong>Formularwerten wie vegan, vegetarisch, gluteinfrei</strong>.','Use this section for filtering columns that should not be excluded if column title contains some specific value. Useful for custom forms fields, etc.'=>'Generell werden alle neuen Spalten ausgeschloßen um die Datenmenge klein zuhalten. Verwende diesen Filtern um Spalten zu definieren, die nicht ausgeschlossen werden sollten, wenn der Spaltentitel einen bestimmten Wert enthält.</br></br>Dies ist nützlich beim Hinzufügen von benutzerdefinierten Formularfeldern im Business Directory Plugin oder den WP Benutzern usw. Diese werden dann automatisch im "WP->Klick Tipp" Tab angezeigt und können dann übertragen werden.','Used as'=>'Verwendet als','User email'=>'E-Mail des Kontakts','User Email:'=>'E-Mail:','User Input Recomended Tags'=>'Tags zum vorab übertragen empfehlen','User tags'=>'Tags des Kontakts','Username'=>'Benutzername (Nur der KlickTipp Admin Benutzer funktioniert!)','Users started transfered in background'=>'-- Wähle ein Modul —','Utilities'=>'Werkzeug','Value is'=>'Spaltewert (z.B. _value)','Version (status)'=>'Status | Version','View Example'=>'Mehr Infos','View more tables for'=>'Zeige weitere Tabellen mit','View search results'=>'Zeige Suchergebnisse','View table'=>'Zeige ganze Tabelle','View your plugins'=>'Zeige deine WP-Plug-ins an','Virtual Relation'=>'<strong>Virtuelle Verknüpfungen</strong> <br> Wann ist die Funktion nötig? Nomalerweise sind die Kontaktdaten eines Kontaktes in einer Zeile. Ist dies wie bei den User-, Produkt-, … Metas nicht der Fall nutzen wir die Funktion,<br>um Werte eines Kontakts die in zwei Spalten geschrieben werden z.B. meta_key, meta_value in eine Zeile zu schreiben. Dann hast du mit dieser Verknüpfung meta_key als Spalten Namen und meta_value als Spalten Wert geschrieben.','Virtual relationship'=>'<strong>Virtuelle Verknüpfungen</strong> <br> Wann ist die Funktion nötig? Nomalerweise sind die Kontaktdaten eines Kontaktes in einer Zeile. Ist dies wie bei den User-, Produkt-, … <strong>Metas</strong> nicht der Fall nutzen wir die Funktion,<br>um Werte eines Kontakts die in zwei Spalten geschrieben werden z.B. meta_key, meta_value in eine Zeile zu schreiben. Dann hast du mit dieser Verknüpfung meta_key als Virtuellen-Spalten-Namen und meta_value als Spalten-Wert geschrieben.','Waiting'=>'Warten','Was Campaign imported?'=>'Wurde die Kampagne importiert und die Felder angelegt?','We are collecting your users data. It could take up to few minutes depending on your server and number of data in DB.'=>'WP2LEADS sammeln lokal Kontaktdaten zusammen. </br>Es kann bis zu 30 Sekunden dauern, </br>abhängig vom Server und der Anzahl der Kontakte in der Datenbank.','We are preparing your users data for transfering to Klick Tipp. It could take up to few minutes depending on your server and number of data in DB. Please be patient and not close or reload the page.'=>'Das Plugin bereiten deine Kontaktdaten für die Übertragung zu KlickTipp vor. </br>Es bis zu 30 Sekunden dauern, abhängig vom Server und der Anzahl der Kontakte in der Datenbank. </br>Bitte habe Geduld und schließe, wechsle oder lade die Seite nicht neu.','We are starting transfering your users data for to Klick Tipp. It could take up to few minutes depending on your server and number of data in DB. Please be patient and not close or reload the page.'=>'WP2LEADS beginnen mit der Übertragung von Kontakten zu KlickTipp. Es kann bis 30 Sekunden dauern, abhängig vom Server und der Anzahl der Daten in der Datenbank. Bitte habe Geduld und schließe, wechsle oder lade die Seite nicht neu.','We highly recommend you to create all tags from this list after you set map prefix. Otherwise you will need to make some settings in tag add / untag conditions later.'=>'Es wird dringend empfohlen, alle Tags aus dieser Liste zu erstellen, nachdem du den Verbindung-Präfix festgelegt hast. <br>Andernfalls müssen einige Einstellungen bei den Bedingungen im Akkordeon „Tags hinzufügen“ / „Tags entziehen“ mühsam manuell gesetzt werden.','We recomend you to use instant module instead of cron'=>'WP2LEADS empfiehlt, das Echtszeitsübertragungs-Modul anstelle von der Automatischen(cron)-Ünertragung zu verwenden.','We recommend you to use timezone by searching for your city to always have the right time e.g. during winter, summer time.'=>'Empfehlung, die automatische Zeitzone zu verwenden. Suche nach der Hauptstadt deines Landes z.B. Berlin, um immer die richtige Zeit in WP z.B. im Winter, Sommer zu haben.','We will contact you on issues with the map. We save email address only inside map server and NOT show it with the map to public. We will use your email address (%s) to inform you about best map practice via our email marketing service. You can opt out on every email sent.'=>'Wir werden dich bei Problemen mit der Verbindung kontaktieren. Wir speichern deine E-Mail-Adresse nur innerhalb des Vorlagen-Servers und zeigen diese NICHT mit der Verbindung der Öffentlichkeit. <br><br>Wir verwenden deine E-Mail-Adresse (%s), um dich über die besten Vorlagenpraktiken über unseren E-Mail-Marketing-Service zu informieren. Du kannst dich bei jeder gesendeten E-Mail mit einem Klick abmelden.','We will update your current tags where it is possible instead of creation new tags.'=>'Wir benennen deine Tags um wo es möglich ist, statt neue Tags anzulegen.','web1'=>'web1','web1_form1'=>'web1_form1','Wednesday'=>'Mittwoch','When Contact Forms Entries plugin is deactivated your forms will not sent any data to Klick-Tipp! <a href="#" id="activateCRM" data-message="Installing...">Activate it</a>'=>'Das "Contact Forms Entries" Plugin ist deaktiviert, deine Formulare senden keine Daten an Klick-Tipp! <a href="#" id="activateCRM" data-message="Installing...">Aktivieren</a>','why failed?'=>'Warum nicht übertragen?','With cron'=>'Automatisch','With this map we have %d extra fields which are not connected to your fields in Klick Tipp please connect them. You may have to manually create new fields. Please be aware of the right field type. For the date and time fields you should check Time Zone after export and change it in the Fields if need.'=>'In dieser Verbindung sind %d zusätzliche Felder enthalten, die nicht mit KlickTipp verbunden sind. Du musst möglicherweise die neuen Felder manuell erstellen. Beachte bitte dem Feld die richtige Art z.B. "Datum, Zahl,..." zu geben. Bitte überprüfe Datum & Zeit Felder nach der Übertragung eines Kontakts und ändere es wenn nötig. Prüfe u.a. die korrekte Uhrzeit und nutze die "GMT" Einstellungen um eine Zeitverschiebung auszugleichen.','With uploading map to map server you agree with our data <a href="https://wp2leads-for-klick-tipp.com/datenschutz/" target="_blank">privacy policy</a> and the points below.'=>'Mit dem Hochladen der Verbindung auf den WP2LEADS Vorlagen-Server stimmst du unserer <a href="https://wp2leads-for-klick-tipp.com/datenschutz/" target="_blank">Datenschutzerklärung</a> und den folgenden Punkten zu:','Woocommerce: Order status changed'=>'Woocommerce: Neue Bestellung und Statusänderung','WordPress Version'=>'WordPress-Version','Works only with virtual columns.'=>'</br></br><strong>Funktioniert nur mit virtuellen Spalten 