Beispiele von Filterwerten:','WP Core: User update'=>'WP Core: Benutzeraktualisierung','WP2LEADS'=>'WP2LEADS','WP2Leads'=>'WP2LEADS','WP2LEADS Changelog'=>'WP2LEADS Changelog','WP2LEADS Support'=>'WP2LEADS Support','Wp2Leads Version'=>'WP2LEADS Version','Yes'=>'Ja','You activated a Multiplicator License, which allows you to use the license for all sites you are the owner of.'=>'Gratuliere ;-) Du hast deine Multiplikator Lizenz aktiviert, die dir die Nutzung der Lizenz für allen deiner Webseiten erlaubt, von denen du der Besitzer bist.','You are not allowed to transfer current map'=>'Diese Verbindung kann nicht übertragen werden','You are on Klick Tipp Standard package with no API access! To connect please upgrade at least to Klick Tipp Premium.'=>'Du nutzt ein KlickTipp Standard-Paket ohne API-Zugriff! </br>Um eine Verbindung herzustellen, aktualisieren bitte mindestens auf Klick Tipp Premium!','You are on Klick Tipp Standard packed with no API access! To connect please upgrade at least to Klick Tipp Premium!.'=>'Du nutzt wahrscheinlich KlickTipp in der Standard Version ohne API-Zugriff! Um eine Verbindung herzustellen, aktualisiere bitte mindestens auf Klick Tipp Premium!.','You can add strotime like 734785638764 or english time like 2020.11.21....'=>'Du kannst strotime hinzufügen wie 734785638764 oder englische Zeit wie 2020.11.21....','You can change links in double opt in settings in Klick Tipp.'=>'Du kannst die Links in den Double-opt-in-Einstellungen auf KlickTipp.com unter "Automatisierung" "Übersicht Double-Opt-in-Prozesse" ändern.','You can change timezone settings <a href="options-general.php#timezone_string" target="_blank">here.</a>'=>'Du kannst die Zeitzone <a href="options-general.php#timezone_string" target="_blank">hier ändern.</a>','You can check column types in search result in Map Headstart Section.'=>'Du kannst die Spaltenarten wie „LONG TEXT“ in den Suchergebnisse oben unter den Spaltennamen sehen.','You can convert date, time and datetime values from local to GMT and gmt to LOCAL time.'=>'Du kannst Datums-, Zeit- und Datum&Zeit-Werte von lokal zu GMT und GMT zu lokaler Zeit konvertieren.','You can not transfer this user'=>'dieser Benutzer kann nicht übertragen werden','You can select displayed tags and create them on Klick-Tipp and after that you can get next tags set and create them.'=>'Du kannst die angezeigten Tags auswählen und mit KlickTipp erstellen. Danach kannst du die nächsten Art von Tags z.B. Kategorien auswählen und erstellen.','You can set up conditions to create new automatic created tags. Otherwise tags always will be created and added.'=>'Du kannst Bedingungen einrichten, um neue Tags automatisch je nach Bedinugung zu übertragen. Andernfalls werden immer Tags erstellt und hinzugefügt.','You can set up conditions to prevent create new or detach tags from automatic created.'=>'Du kannst Bedingungen einrichten, um den Wert zu bestimmen beidem die Tags ggf. erstellt und hinzugefügt werden.','You can transfer'=>'Übertragbare Kontakte','You can transfer <strong>%s</strong> users out of your <strong>Pro Version</strong> limit for <strong>%s</strong> users per <strong>%s</strong> days.'=>'Du kannst <strong>%s</strong>-Kontakte von <strong>%s-Kontakte</strong> alle <strong>%s-Tage</strong> übertragen. <a href="https://wp2leads-for-klick-tipp.com/web/go-pro-plus-get-all-done4u/" target="_blank">Jetzt bitte hier klicken und Lizenz kaufen und unbegrenzt Daten übertragen.</a>','You can use Professional license until %s.'=>'Du kannst die Professional-Lizenz bis %s nutzen.','You do not have any failed items for current map.'=>'Du hast keine nicht übertragenen Kontakte für diese Verbindung.','You do not have any transfering data.'=>'Du hast noch keine Daten übertragen.','You have %s users to transfer out of your Pro Version limit for %s users per %s days.'=>'Du kannst noch <strong>%s</strong> vom %s-<strong>Kontakten</strong> übertragen. (Reset des Volumens alle %s-Tage) <br><a href="https://wp2leads.com/#preise" target="_blank">Jetzt hier klicken, Lizenz kaufen und sofort unbegrenzt Kontakte übertragen.</a>','You have <strong>%s</strong> users to transfer out of your <strong>Pro Version</strong> limit for <strong>%s</strong> users per <strong>%s</strong> days.'=>'Du kannst noch <strong>%s</strong> vom %s-<strong>Kontakten</strong> übertragen. (Reset des Volumens alle %s-Tage) <br><a href="https://wp2leads.com/#preise" target="_blank">Jetzt hier klicken, Lizenz kaufen und sofort unbegrenzt Kontakte übertragen.</a>','You have an issue with your Multiplicator license.'=>'Es gibt ein Problem mit deiner Multiplikator-Lizenz.','You have exceeded your <strong>Pro Version</strong> limit for <strong>%s</strong> users per <strong>%s</strong> days.'=>'Du hast das <strong>freie Übertragungsvolumen mit allen Pro Funktionen</strong> von <strong>%s-Kontakten</strong> alle <strong>%s-Tage</strong> überschritten! <br><a href="https://wp2leads.com/#preise" target="_blank">Jetzt hier klicken, Lizenz kaufen und sofort unbegrenzt Kontakte übertragen.</a>','You have exceeded your Pro Version limit for %s users per %s days.'=>'Du hast das <strong>freie Übertragungsvolumen mit allen Pro Funktionen</strong> von <strong>%s-Kontakten</strong> alle <strong>%s-Tage</strong> überschritten! <br><a href="https://wp2leads.com/#preise" target="_blank">Jetzt hier klicken, Lizenz kaufen und sofort unbegrenzt Kontakte übertragen.</a>','You have maps with no any data for it. To activate and use it you should do the next:'=>'Du hast Verbindungen die noch keine Benutzerdaten enthalten. Um diese Verbindungen zu aktivieren solltest du folgendes tun:','You have new fields in your map ID %s, please check them on <a href="?page=wp2l-admin&tab=map_to_api&active_mapping=%s">Map To API tab</a>.'=>'Du dein Formular gespeichert und hast ggf. neue Felder, Tags in der Verbindung %s, bitte überprüfen diese im <a href="?page=wp2l-admin&tab=map_to_api&active_mapping=%s">WP -> KlickTipp</a>.','You have the map with this name. Choose another name.'=>'Du hast schon eine Verbindung mit diesem Namen. Wähle einen anderen Namen aus.','You have WP Cron disabled on your site, background and cron transferring could not be run. Please, remove <strong>"DISABLE_WP_CRON"</strong> constant in your <strong>wp-config.php</strong> file, or set it to <strong>false</strong>'=>'Du hast den WP Cron auf deiner Seite deaktiviert! Hintergrund und Cron-Übertragung konnten nicht ausgeführt werden. Entferne die <strong> "DISABLE_WP_CRON" </strong> -Konstante in deiner <strong> wp-config.php </strong> -Datei oder setzen den Wert auf <strong> false </strong>','You must be logged in to KT account to continue working with this map.'=>'Gebe bitte KlickTipp <strong>Admin</strong> Benutzernamen und Passwort ein um weiter mit dieser Verbindung zu arbeiten. <br>Damit kann das Plugin Tags und Felder aus Klick Tipp laden und mit deinen WordPress Kontaktdaten füllen.','You must provide a name for the map'=>'Bitte einen Namen für die Verbindung angeben.','You should install and activate required plugins to use this map.'=>'Du solltest die erforderliche Plugins installieren und aktivieren, um diese Verbindung zu verwenden.','Your %s Version is outdated and stopped working! Please update the plugin: <a href="plugins.php?plugin_status=upgrade">Go to the update.</a>'=>'Deine %s Version ist veraltet und funktioniert nicht mehr! Bitte aktualisieren das Plugin: <a href="plugins.php?plugin_status=upgrade"> zum Update. </a>','Your %s Version nearly outdated and will stopped working with the release of the next version! Please update the plugin: <a href="plugins.php?plugin_status=upgrade">Go to the update.</a>'=>'Deine %s Version fast veraltet und wird mit der Veröffentlichung der nächsten Version aufhören! Bitte aktualisieren das Plugin: <a href="plugins.php?Plugin_status=Upgrade"> Zum Update. </a>','Your activation is in progress. You need to Complete this to securely save your license data.'=>'Deine Lizenz ist gültig. Die Lizenzverwaltung ist geöffnet bitte „Lizenzverwaltung schließen“ klicken um Aktivierung abzuschließen.','Your license was deactivated.'=>'Deine Lizenz wurde deaktiviert.','Your link to Klick-Tipp Consultant profile page or marketing agency home page still not approved.'=>'Dein Link zum KlickTipp-Berater-Profil oder zur Marketing-Agentur/Multiplikator Webseite wurde noch nicht genehmigt.','Your link to link to Imprint page still not approved.'=>'Dein Link zum Impressum wurde noch nicht genehmigt.','Your Professional license deactivated because your link to Imprint page was rejected.'=>'Dein Professional-Lizenz wurde deaktiviert, da dein Link auf dein Impressum abgelehnt wurde.','Your Professional license deactivated because your link to Klick-Tipp Consultant profile page or marketing agency home page was rejected.'=>'Deine Professional-Lizenz wurde deaktiviert, da dein link zum KlickTipp-Berater-Profil oder Marketing-Agentur/Multiplikator-Homepage abgelehnt wurde.','Your Professional license was deactivated because of activation issues.'=>'Deine Professional-Lizenz wurde deaktiviert, da es Probleme bei der Aktivierung gab.','Your web hosting is blocking the connection to our server so we can not load catalog items. Please write your web hosting and let them add the full URL https://maps.wp2leads.com/server/maps.php to the server whitelist. Sorry for the trouble.'=>'Dein Webhosting blockiert die Verbindung zu unserem Server, sodass wir den Verbindungskatalog nicht laden können. Bitte schreibe deinen Webhoster an und lass ihn die vollständige URL https://maps.wp2leads.com/server/maps.php in die Whitelist des Servers aufnehmen. Wir entschuldigen uns für den Ärger.','Your web hosting is blocking the connection to our server so we can not load license and catalog items. Please write your web hosting and let them add our ip address 116.202.216.211 to the server whitelist. Sorry for the trouble.'=>'Dein Webhosting blockiert die Verbindung zu unserem Server, sodass wir keine Lizenz- und Katalogelemente laden können. Bitte schreibe dein Webhosting an und lasse es unsere IP-Adresse 116.202.216.211 zur Server-Whitelist hinzufügen. Sorry für den Ärger.']];
